        // Read data from the file. Assume that the file written by some other application
        // And we are going to read the same data here
        using (StreamReader sr = new(Shared.FilePath))
        {
            string? line;
            int lineNumber = 0;

            // Create a chunk (an empty list of string)
            List<string> chunks = new();

            int threadCount = 0;

            // Create a semaphore to limit the number of concurrent threads at a time
            Semaphore semaphore = new(Shared.MaxConcurrency, Shared.MaxConcurrency);

            // Read each line from the file
            while ((line = sr.ReadLine()) != null)
            {
                // Skip the iteration if the line is null
                if (string.IsNullOrEmpty(line)) continue;

                // Format: id,first_name,last_name,email,gender

                // Line is not null, then increase the line count
                lineNumber++;

                chunks.Add(line);

                // If reach to end of chunk
                if (lineNumber % Shared.ChunkSize == 0)
                {
                    threadCount++;

                    // Create duplicate copy of chunk
                    List<string> chunkCopy = chunks.Select(item => item).ToList();

                    // Create chunk name
                    string chunkName = $"Chunk {threadCount}";

                    // Create thread object to handle chunk
                    ThreadPool.QueueUserWorkItem((state) =>
                    {
                        // Each thread has to aquire the semaphore and release independently

                        // wait for the semaphore to be available
                        semaphore.WaitOne();
                        // In case if there is an exception in InvokeDataProcessor
                        try
                        {
                            InvokeDataProcessor(chunkName, chunkCopy);
                        }
                        catch (Exception ex)
                        {
                            Console.WriteLine(ex.Message);
                        }
                        finally
                        {
                            // Release the slot
                            semaphore.Release();
                        }
                    });

                    // These are not needed when we use ThreadPool
                    //threads.Add(thread);
                    //thread.Start();

                    // Clear Chunks
                    chunks.Clear();
                }
            }

            // Process the last chunk (if any), if threre are 1002 line
            if (chunks.Count > 0)
            {
                // Update count from last process
                threadCount++;

                // Create chunk name
                string chunkName = $"Chunk {threadCount}";

                // Create thread object to handle chunk
                ThreadPool.QueueUserWorkItem((state) =>
                {
                    InvokeDataProcessor(chunkName, chunks);
                });

                // These are not needed
                //threads.Add(thread);
                //thread.Start();
            }

            // Main thread will wait until completion of child threads
            //foreach (Thread thread in threads)
            //{
            //    thread.Join();
            //}
        }

        Console.WriteLine("\nAll CSV lines has been processed.");
        Console.ReadKey();
    }

    private static void InvokeDataProcessor(string chunkName, List<string> chunk)
    {
        // Create an object of DataProcessor class
        DataProcessor dataProcessor = new()
        {
            ChunkName = chunkName,
            Chunk = chunk,
        };

        Console.WriteLine($"\nProcessing {dataProcessor.ChunkName} of size {chunk.Count}");

        // Invoke ProcessChunk method to perform actual process of data
        dataProcessor.ProcessChunk();

        // Print output
        // This block of code will be executed by only one thread.
        // It ensures that all remaining threads that reach this block of code will wait until the mutex release
        try
        {
            Shared.mutex.WaitOne();

            Console.WriteLine($"\nProcessed {dataProcessor.ChunkName} of size: {chunk.Count}");
            Console.WriteLine($"{dataProcessor.ChunkName}");

            foreach (var gender in dataProcessor.GenderCount)
            {
                Console.WriteLine($"{gender.Key}: {gender.Value}");
            }
        }
        catch (Exception ex)
        {
            Console.WriteLine(ex.Message); ;
        }
        finally
        {
            Shared.mutex.ReleaseMutex();
        }
    }
}